import { useState } from 'react';
import './App.css';
import Choose from './components/Choose/Choose';
import Inform from './components/Inform/Inform';
import Status from './components/Status/Status';
import Table from './components/Table/Table';

function App() {
  const [phase, setPhase] = useState(0);

  return (
    <div className="App">
      <div class="app">
        <Status phase={phase} setPhase={setPhase}/>
        <Table phase={phase} setPhase={setPhase}/>
        <Inform phase={phase} setPhase={setPhase}/>
        <Choose phase={phase} setPhase={setPhase}/>
      </div>
    </div>
  );
}

export default App;
